    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE - col2 * col0 + - col1 * 90 * + col1 NOT IN ( col2 / - col0 + + ( - col1 ) / - 68 );
  - name: tab2

outputs:
  - name: q13512.out
    data: |
      46	51	23
      64	77	40
      75	67	58
